import{_ as o,c as t,o as e,a4 as n}from"./chunks/framework.uQk9_EO2.js";const r="data:image/png;base64,",a="/docs/cocos/assets/as-setting.DshgO8VY.png",d="/docs/cocos/assets/download-sdk.XxrVkZ8r.png",i="/docs/cocos/assets/confirm-change.z5Cj4jrM.png",s="/docs/cocos/assets/component-installer.CpYCBp6D.png",l="/docs/cocos/assets/sdk-location.EZ2G9ywR.png",A="/docs/cocos/assets/http-proxy.BA5gtFRc.png",p="data:image/png;base64,",c="/docs/cocos/assets/download-ndk-by-as.Cdtdd_FB.png",h="/docs/cocos/assets/download-ndk.DLukg4h8.png",g="/docs/cocos/assets/program.BWZSID8v.png",u="/docs/cocos/assets/ndk-dir.BWWlIvAR.png",m="/docs/cocos/assets/sdk-dir.D45UGZ5G.png",N=JSON.parse('{"title":"Android Development Environment Setup","description":"","frontmatter":{},"headers":[],"relativePath":"en/editor/publish/android/build-setup-evn-android.md","filePath":"en/editor/publish/android/build-setup-evn-android.md","lastUpdated":1712305443000}'),f={name:"en/editor/publish/android/build-setup-evn-android.md"},D=n('<h1 id="android-development-environment-setup" tabindex="-1">Android Development Environment Setup <a class="header-anchor" href="#android-development-environment-setup" aria-label="Permalink to &quot;Android Development Environment Setup&quot;">​</a></h1><h2 id="download-android-studio" tabindex="-1">Download Android Studio <a class="header-anchor" href="#download-android-studio" aria-label="Permalink to &quot;Download Android Studio&quot;">​</a></h2><p>Developers should download the appropriate IDE from the <a href="https://developer.android.com/studio" target="_blank" rel="noreferrer">official Android Studio</a>.</p><p>Reference Setting up the <a href="./../setup-native-development#Android Platform Dependencies">Native Development Environment</a> to set up the development environment</p><h2 id="download-and-install-jdk" tabindex="-1">Download and install JDK <a class="header-anchor" href="#download-and-install-jdk" aria-label="Permalink to &quot;Download and install JDK&quot;">​</a></h2><p>Reference <a href="./../setup-native-development#Downloading the Java SDK" title="JDK">Native Development Environment</a></p><p>Type <code>java -version</code> in the terminal to verify if the installation is successful.</p><p><img src="'+r+'" alt="terminal.png"></p><blockquote><p>Please refer to <a href="https://www.java.com/en/download/help/path.html" target="_blank" rel="noreferrer">How do I set or change the PATH system variable?</a> to set up your environment<br></p><p><strong>Note</strong>：The author utilizes <a href="https://openjdk.org/" target="_blank" rel="noreferrer">OpenJDK</a>, which has similar features as the JDK but follows another open-source protocol.</p></blockquote><p>Download and install the Android SDK</p><h3 id="auto-download" tabindex="-1">Auto Download <a class="header-anchor" href="#auto-download" aria-label="Permalink to &quot;Auto Download&quot;">​</a></h3><p>Here is an example of how to download Android SDK through Android Studio</p><ol><li><p>Start Android Studio</p></li><li><p>Open the Settings/Preferences panel from the main menu <img src="'+a+'" alt="as-setting.png"></p><blockquote><p>The name of the setting panel differs on the platform. It is called <strong>Settings</strong> on Windows but <strong>Preferences</strong> on MacOS.</p></blockquote></li><li><p>Navigate to the Android SDK page in the Settings/Preferences panel. <img src="'+d+'" alt="download-sdk.png"></p></li><li><p>Select at least one suitable SDK to download. You can choose the recommended version mentioned in <a href="./../setup-native-development#Downloading the20SDK20and20NDK20required20to20publish20to20the Android platform">Downloading the SDK and NDK required to publish to the Android platform</a>.</p><ul><li><p>As an example, we will be using Android 11.0 (R). Check the box next to the name and then click either the OK or Apply button to proceed</p></li><li><p>Click the OK button in the pop-up dialog <img src="'+i+'" alt="confirm-change.png"></p></li><li><p>Please wait until the download is finished <img src="'+s+'" alt="component-installer.png"></p></li></ul></li></ol><h3 id="manually-downloading-the-android-sdk" tabindex="-1">Manually downloading the Android SDK <a class="header-anchor" href="#manually-downloading-the-android-sdk" aria-label="Permalink to &quot;Manually downloading the Android SDK&quot;">​</a></h3><p>In case of network connectivity issues, you can manually download the Android SDK and put it in the directory configuring in <strong>Android SDK Location</strong>.</p><p>You could click the <strong>Edit</strong> button to choose a different path.</p><p><img src="'+l+'" alt="sdk-location.png"></p><p>You can change to use SDK mirrors(Optional) by setting HTTP Proxy in Android Studio. <strong>Auto-detect proxy settings：</strong> In the Settings panel of Android Studio, navigate to the HTTP Proxy and select the <strong>Auto-detect proxy settings</strong> option, and then input the mirror links below.</p><p><img src="'+A+'" alt="http-proxy.png"></p><p><strong>Choose specific mirrors：</strong> Here are some alternative mirrors for the Android SDK and Gradle that can help developers resolve download issues when downloading failed from the official website. However, if these mirrors do not work, you may need to search for other mirrors.</p><table><thead><tr><th style="text-align:left;">Mirror</th><th style="text-align:left;">Address</th></tr></thead><tbody><tr><td style="text-align:left;">Tencent(CN)</td><td style="text-align:left;"><a href="https://mirrors.cloud.tencent.com/AndroidSDK/" target="_blank" rel="noreferrer">https://mirrors.cloud.tencent.com/AndroidSDK/</a></td></tr><tr><td style="text-align:left;">AliCloud(CN)</td><td style="text-align:left;"><a href="https://mirrors.aliyun.com/android.googlesource.com/" target="_blank" rel="noreferrer">https://mirrors.aliyun.com/android.googlesource.com/</a></td></tr></tbody></table><blockquote><p>In case these mirrors are not working, please search for other valid mirrors.</p></blockquote><h2 id="download-and-install-android-ndk" tabindex="-1">Download And Install Android NDK <a class="header-anchor" href="#download-and-install-android-ndk" aria-label="Permalink to &quot;Download And Install Android NDK&quot;">​</a></h2><p>Please refer to <a href="./../setup-native-development#Downloading the SDK and NDK required to publish to the Android platform">Downloading the SDK and NDK required to publish to the Android platform</a> to download the appropriate version of Android NDK(<strong>r18~21</strong>).</p><h3 id="download-the-android-ndk-from-android-studio" tabindex="-1">Download the Android NDK from Android Studio <a class="header-anchor" href="#download-the-android-ndk-from-android-studio" aria-label="Permalink to &quot;Download the Android NDK from Android Studio&quot;">​</a></h3><p>Navigate to the <strong>Android SDK</strong> page in Android Studio <strong>Settings</strong> panel.</p><blockquote><p><strong>Note</strong>: check <strong>Show Package Details</strong><img src="'+p+'" alt="show-package-details.png"></p></blockquote><p><img src="'+c+'" alt="download-ndk-by-as.png"></p><p>Make sure to select the appropriate version to download. If the list fails to refresh, you can follow the steps in the next section to manually download the Android NDK.</p><h3 id="manually-download" tabindex="-1">Manually download <a class="header-anchor" href="#manually-download" aria-label="Permalink to &quot;Manually download&quot;">​</a></h3><p>You could find the historical versions of Android NDK <a href="https://github.com/android/ndk/wiki/Unsupported-Downloads#r20b" target="_blank" rel="noreferrer">here</a></p><p>For instance, let&#39;s consider the version r20b, which can be found in the link provided above. Make sure to select the appropriate version according to your operating system, and extract it to the directory previously set as the Android SDK Location.</p><p><img src="'+h+'" alt="download-ndk.png"></p><h2 id="configure-android-sdk-and-ndk-in-cocos-creator" tabindex="-1">Configure Android SDK and NDK in Cocos Creator <a class="header-anchor" href="#configure-android-sdk-and-ndk-in-cocos-creator" aria-label="Permalink to &quot;Configure Android SDK and NDK in Cocos Creator&quot;">​</a></h2><p>Navigate to the <strong>Preferences</strong> panel in Cocos Creator by clicking the <strong>File</strong> -&gt; <strong>Preferences</strong> menu. From there go to the <strong>Program Manager</strong> page and configure the <strong>Android SDK</strong> and <strong>Android NDK</strong> properties with the following images.</p><p><img src="'+g+'" alt="program.png"></p><p>The path should be like follows:</p><p><strong>NDK</strong>:</p><p><img src="'+u+'" alt="ndk-dir.png"></p><p><strong>SDK</strong>:</p><p><img src="'+m+'" alt="sdk-dir.png"></p>',41),b=[D];function w(k,v,K,B,T,Y){return e(),t("div",null,b)}const P=o(f,[["render",w]]);export{N as __pageData,P as default};
